            <Route path="/AirPods" element={<AirPods/>}/>
            <Route path="/Accessories" element={<Accessories/>}/>
            <Route path="/Support" element={<Support/>}/>
            <Route path="/Brands" element={<Brands/>}/>
        </Routes>
        </>
        );
};

export default App;
